div.ui-svg svg{
    color: var(--nr-dashboard-widgetColor);
    fill: currentColor !important;
}
div.ui-svg path {
    fill: inherit;
}

func:
var value = msg.payload;
msg.payload = {
    "command": "update_text",
    "selector": "#temp",
    "textContent": value
};
return msg;

var obtain_global_temp = global.get("global_temp");
msg.payload = obtain_global_temp;
msg.title = "temp";
return msg;

var opts = {
    reply_markup: JSON.stringify({
        "inline_keyboard": [[
            {
                "text": "Start heating",
                "callback_data": "heat"
            }
            ]
        ]
    })
};

msg.payload = {
    chatId: "5982914586",
    messageId: "6",
    sentMessageId: "6",
    type: "message",
    content: "Temp: " + msg.payload + " - too low"
};
msg.payload.options = opts;
return msg;

var opts = {
  reply_markup: JSON.stringify({
    "inline_keyboard": [[
      {
        "text": "Start cooling",
        "callback_data": "cool"
      }
      ]
    ]
  })
};

msg.payload = {
  chatId: "5982914586",
  messageId: "6",
  sentMessageId: "6",
  type: "message",
  content: "Temp: " + msg.payload + " - too high"};
msg.payload.options = opts;
return msg;

var text = "Cooling.";
var options = {

    show_alert: true,
    cache_time: 5
};

msg.payload.content = text;
msg.payload.options = options;
msg.payload.type = "answerCallbackQuery";

return [msg];

var text = "Heating.";
var options = {

    show_alert: true,
    cache_time: 5
};

msg.payload.content = text;
msg.payload.options = options;
msg.payload.type = "answerCallbackQuery";

return [msg];
